        price: '40$'
    },
    {
        name: 'Shoes',
        description: 'Running Shoes',
        price: '40$'
    }
])
    return (
        <div>
            {
                products.map(()=>{
                    return (
                        <Product product={products}/>
                    )
                })
            }
        </div>
    )
}

export default Products
